import React, { Component } from 'react'
import Logo from './logo/Logo'
import RegJyrMid from './RegJyrMid'

class RegJyr extends Component {

    render() {
        return (
            <div className="wrapper">
                <Logo />
                <RegJyrMid props={this.props.props} />
            </div>
        )
    }
}
export default RegJyr
